INSERT INTO `ntrenz_cms_block` (`block_id`, `title`, `identifier`, `content`, `creation_time`, `update_time`, `is_active`) VALUES
(1, 'Footer Links', 'footer_links', '<ul>\r\n<li><a href="{{store direct_url="about-us"}}">About Us</a></li>\r\n<li><a href="{{store direct_url="customer-service"}}">Customer Service</a></li>\r\n<li class="last privacy"><a href="{{store direct_url="privacy-policy"}}">Privacy Policy</a></li>\r\n</ul>', '2016-02-04 10:19:01', '2016-03-01 00:21:09', 1),
(2, 'Footer Links Company', 'footer_links_company', '<div class="links">\r\n<div class="block-title"><strong><span>Company</span></strong></div>\r\n<ul>\r\n<li><a href="{{store url=""}}about-us/">About Us</a></li>\r\n<li><a href="{{store url=""}}contacts/">Contact Us</a></li>\r\n<li><a href="{{store url=""}}customer-service/">Customer Service</a></li>\r\n<li><a href="{{store url=""}}privacy-policy/">Privacy Policy</a></li>\r\n</ul>\r\n</div>', '2016-02-04 10:19:02', '2016-03-01 00:21:49', 1),
(3, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2016-02-04 10:19:02', '2016-02-04 10:19:02', 1);
